import React from 'react'
import { useReactTable, getCoreRowModel, flexRender, ColumnDef } from '@tanstack/react-table'
import { Table, TableHeader, TableBody, TableRow, TableHead, TableCell } from './ui/table'
import { DropdownMenu, DropdownMenuTrigger, DropdownMenuContent, DropdownMenuItem, DropdownActionEdit, DropdownActionDelete } from './ui/dropdown'

type DataTableProps<T> = {
  columns: ColumnDef<T, any>[]
  data: T[]
  onEdit?: (row: T) => void
  onDelete?: (row: T) => void
  onPrint?: (row: T, reportType: 'nilai' | 'sikap' | 'identitas', format: 'docx' | 'pdf') => void
  searchKey?: string
}

export default function DataTable<T>({ columns, data, onEdit, onDelete, onPrint, searchKey }: DataTableProps<T>) {
  const table = useReactTable({ data, columns, getCoreRowModel: getCoreRowModel() })

  return (
    <div className="space-y-4">
      <div className="rounded-md border bg-white">
        <Table>
          <TableHeader>
            {table.getHeaderGroups().map(hg => (
              <tr key={hg.id}>
                {hg.headers.map(h => (
                  <TableHead key={h.id}>{h.isPlaceholder ? null : flexRender(h.column.columnDef.header, h.getContext())}</TableHead>
                ))}
              </tr>
            ))}
          </TableHeader>
          <TableBody>
            {table.getRowModel().rows.length ? table.getRowModel().rows.map(row => (
              <TableRow key={row.id}>
                {row.getVisibleCells().map(cell => (
                  <TableCell key={cell.id}>
        {cell.column.id === 'actions' ? (
                      <div className="flex justify-end">
                        <DropdownMenu>
                          <DropdownMenuTrigger className="h-8 w-8 p-0" />
                          <DropdownMenuContent align="end" className="w-[200px]">
                            {/* Print options: render only when onPrint callback is provided (manajemen siswa) */}
                            {onPrint && (
                              <>
                                <div className="px-2 py-1.5 text-sm font-semibold">Cetak Rapor</div>
                                <DropdownMenuItem className="cursor-pointer" onClick={() => onPrint?.(row.original as T, 'nilai', 'docx')}>
                                  Rapor Nilai (DOCX)
                                </DropdownMenuItem>
                                <DropdownMenuItem className="cursor-pointer" onClick={() => onPrint?.(row.original as T, 'nilai', 'pdf')}>
                                  Rapor Nilai (PDF)
                                </DropdownMenuItem>
                                <div className="px-2 py-1.5 text-sm font-semibold">Rapor Sikap</div>
                                <DropdownMenuItem className="cursor-pointer" onClick={() => onPrint?.(row.original as T, 'sikap', 'docx')}>
                                  Rapor Sikap (DOCX)
                                </DropdownMenuItem>
                                <DropdownMenuItem className="cursor-pointer" onClick={() => onPrint?.(row.original as T, 'sikap', 'pdf')}>
                                  Rapor Sikap (PDF)
                                </DropdownMenuItem>
                                <div className="px-2 py-1.5 text-sm font-semibold">Identitas</div>
                                <DropdownMenuItem className="cursor-pointer" onClick={() => onPrint?.(row.original as T, 'identitas', 'docx')}>
                                  Identitas (DOCX)
                                </DropdownMenuItem>
                                <DropdownMenuItem className="cursor-pointer" onClick={() => onPrint?.(row.original as T, 'identitas', 'pdf')}>
                                  Identitas (PDF)
                                </DropdownMenuItem>
                              </>
                            )}
                            {/* Edit/Delete actions */}
                            {(onEdit || onDelete) && !onPrint && (
                              <div className="py-1">
                                {onEdit && <DropdownActionEdit className="cursor-pointer w-full justify-start" onClick={() => onEdit?.(row.original as T)} />}
                                {onDelete && <DropdownActionDelete className="cursor-pointer w-full justify-start" onClick={() => onDelete?.(row.original as T)} />}
                              </div>
                            )}
                          </DropdownMenuContent>
                        </DropdownMenu>
                      </div>
                    ) : (
                      flexRender(cell.column.columnDef.cell, cell.getContext())
                    )}
                  </TableCell>
                ))}
              </TableRow>
            )) : (
              <tr><td colSpan={columns.length} className="p-4 text-center">No results.</td></tr>
            )}
          </TableBody>
        </Table>
      </div>
    </div>
  )
}

// ensure this file is treated as a module under --isolatedModules
export {}
